/** @jsx jsx */
import { jsx, css } from '@emotion/core';
import React from 'react';
import Layout from '../components/Layout';

const background = css `
  background-color: rgb(176,197,210);
  width: 1000px;
  height: 800px;
  border-radius: 25px;
  margin-left: auto;
  margin-right: auto;
`;

const form = css `
  background-color: white;
  width: 800px;
  height: 600px;
  border-radius: 25px;
  margin-left: auto;
  margin-right: auto;
  margin-top: 60px;
`;

function Contact() {
  return (
    <Layout>
      <h1>Contact Me</h1>
      <div css={background}>
        <form action="mailto:meganliles426@gmail.com" method="post" enctype="text/plain">
          <div css={form}>
            <input type="text" placeholder="Name" name="name"></input><br/>
            <input type="text" placeholder="Email" name="mail"></input><br/>
            <input type="text" placeholder="Message" name="comment" size="50"/><br/><br/>
            <input type="submit" value="Send"></input>
          </div>
        </form>
      </div>
    </Layout>
  );
}

export default Contact;
